import React from "react";
import {
    Pressable,
    View,
} from 'react-native';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

const stack = createStackNavigator();
function Cari({navigation}){

const onPressHandler = () => {
  navigation.navigate("Hasil Pencarian");
}

  return(
    <View>
      <text>ini screen untuk mencari jadwal</text>
      <Pressable 
      onPress={onPressHandler}
      style={({ pressed }) => ({backgroundColor: pressed ? '#ddd' : '#0f0'})}>
        <text>pergi ke hasil pencarian</text>
      </Pressable>
    </View>
  )
}

function hasilPencarian(){
  return(
    <View>
      <text>ini screen untuk mencari melihat hasil pencarian</text>
    </View>
  )
}
function App(){
  return(
    <NavigationContainer>
      <stack.Navigator>
        <stack.Screen
          name="Cari"
          component={Cari}
          options={{
            header: () => null
          }}
        />
         <stack.Screen
          name="Hasil Pencarian"
          component={hasilPencarian}
        />
      </stack.Navigator>
    </NavigationContainer>
  )
}


export default App;
